import {  BrowserRouter, Routes,Route} from 'react-router-dom'
import { Login } from './component/login';
import Home from './component/home';


function App(e) {
  const r =<Route path='home' element={<Home/>}/>
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Login/>}/>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
